def chars_from_mapping(mapping):
	l = mapping.split(' ')
	char_mapping = [chr(int(a, 16)) for a in l]
	return char_mapping

def complexSort(s, mapping):
	mapped_chars = [mapping[ord(c)] for c in s]
	sorted_chars = sorted(mapped_chars)
	return ''.join(sorted_chars)

